import styled, { css } from 'styled-components'

const Header = styled.div`
  height: 100px;
  background: white;
  color: white;

  ${props => props.theme && css`
    background: ${props.theme};
  `}
`;


const AppLayout = () => {
    return (
        <>
            <Header theme={'red'}>
                Header
            </Header>
            <div>
                Content
            </div>
        </>
    )
}
export default AppLayout;
